import React, { Component } from 'react'
import './App.css';

export class ListOfPeople extends Component {
    constructor(props){
        super(props)
        this.state = {
            personData : this.props
        }
        this.onDelete = this.onDelete.bind(this);
    }

    onDelete(){
        console.log();
    }

    
    render() {
        return (
            <div>
                <table className = 'user-info'>
                   <thead>
                   <tr>
                      <th>Name</th>
                      <th>Email</th>
                      <th>Age</th>
                    </tr>
                   </thead>
                    {
                      this.state.personData.list.map(user =><tbody key = {user._id}>
                                                <tr>
                                                  <td>{user.name}</td>
                                                  <td>{user.email}</td>
                                                  <td>{user.age}</td>
                                                  <td><button>Edit</button></td>
                                                  <td><button onClick = {() => onDelete(user._id)}>Delete</button></td>
                                                </tr>
                                          </tbody>)
                    }

                  </table>
                
            </div>
        )
    }
}

export default ListOfPeople
